import React from 'react';

import {
  Container,
  Info,
  InfoText,
  InfoButton,
  InfoButtonIcon,
  Image,
} from './styles';

const Index: React.FC = () => {
  return (
    <Container>
      <Text>Encontre dados do Covid-19 em Sergipe</Text>
      <Image />
      <Button>
        Ver Dados
        <ButtonIcon />
      </Button>
    </Container>
  );
};

export default Index;
